import React, { useContext } from 'react';
import ColorContext from './ColorContextStore'

export default function Header() {

    const ContextHook = () => {
        const {color} = useContext(ColorContext)
        return (
            <div color={color}>
                {`Hook: ${color}`}
            </div>
        );
    };
    return (
        <>
            
                <div>
                    <ContextHook />
                </div>
            <header className="header">
                <div>About Coffee</div>
            </header>
        </>
    );
}
